(928, 214, 'intro_wysiwyg_intro_gauche', '<div id=\"uniqName_4_140\" class=\"chat-message__item\" data-id=\"00661976682789355520\">\r\n<div class=\"chat-message__item-wrapper\">\r\n<div class=\"chat-message__item-text\">\r\n<div class=\"chat-message__item-preview-full markdown\">\r\n\r\nLa scénographie de notre magasin est conçue pour vous inspirer. Tous les meubles, luminaires et tissus sont présentés dans des ambiances tantôt cottage, moderne, classique ou design.\r\n\r\nNous proposons également des services d’architecte d’intérieur en combinaison avec l’achat de mobilier ainsi que du garnissage et de la tapisserie d’ameublement.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>'),
